  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Crosby
  Waterfowl Production Area Management Office outlines Refuge accomplishments during
  the 1965 calendar year. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover conditions during the year.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and reptiles- is also covered. The Refuge
  development and maintenance section discusses physical developments, plantings,
  collections and receipts, and vegetation control. The public relations section of
  the report describes recreational uses, Refuge visitors, Refuge participation, hunting,
  violations, and safety. Photographs are attached.\",\n\t\"license_title\": \"License
